css:
atom-text-editor {
  -webkit-font-smoothing: antialiased;
}
atom-text-editor,
:host {
  background-color: #25313d;
  color: #eeeeee;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #25313d;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #384a5d;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #384a5d;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #25313d;
  color: #eeeeee;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #384a5d;
  color: #eeeeee;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #eeeeee;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #666666;
}
atom-text-editor .invisible,
:host .invisible {
  color: #eeeeee;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #2f3e4d;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #666666;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #666666;
}
.entity.name.type {
  color: #ffcc99;
}
.entity.other.inherited-class {
  color: #ff6666;
}
.keyword {
  color: #ffcc22;
}
.keyword.control {
  color: #ffcc22;
}
.keyword.operator {
  color: #eeeeee;
}
.keyword.other.special-method {
  color: #aaff66;
}
.keyword.other.unit {
  color: #ffcc66;
}
.storage {
  color: #ffcc22;
}
.storage.todo {
  color: #666666;
}
.constant {
  color: #ffcc66;
}
.constant.character.escape {
  color: #88ee88;
}
.constant.numeric {
  color: #ffcc66;
}
.constant.other.color {
  color: #88ee88;
}
.constant.other.symbol {
  color: #ff6666;
}
.variable {
  color: #88eedd;
}
.variable.interpolation {
  color: #5be8d0;
}
.variable.parameter.function {
  color: #eeeeee;
}
.invalid.illegal {
  background-color: #ff6666;
  color: #25313d;
}
.string {
  color: #ffcc66;
}
.string.regexp {
  color: #88ee88;
}
.string.regexp .source.ruby.embedded {
  color: #ffcc66;
}
.string.other.link {
  color: #88eedd;
}
.punctuation.definition.comment {
  color: #666666;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #eeeeee;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #aaff66;
}
.punctuation.definition.bold {
  color: #ffcc99;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #ffcc22;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #5be8d0;
}
.support.class {
  color: #ffcc99;
}
.support.function {
  color: #88ee88;
}
.support.function.any-method {
  color: #aaff66;
}
.entity.name.function {
  color: #aaff66;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffcc99;
}
.entity.name.section {
  color: #aaff66;
}
.entity.name.tag {
  color: #88eedd;
}
.entity.other.attribute-name {
  color: #ffcc66;
}
.entity.other.attribute-name.id {
  color: #aaff66;
}
.meta.class {
  color: #ffcc99;
}
.meta.link {
  color: #ffcc66;
}
.meta.require {
  color: #aaff66;
}
.meta.selector {
  color: #ffcc22;
}
.meta.separator {
  background-color: #334455;
  color: #eeeeee;
}
.none {
  color: #eeeeee;
}
.markup.bold {
  color: #ffcc66;
  font-weight: bold;
}
.markup.changed {
  color: #ffcc22;
}
.markup.deleted {
  color: #88eedd;
}
.markup.italic {
  color: #ffcc22;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #aaff66;
}
.markup.inserted {
  color: #ff6666;
}
.markup.list {
  color: #88eedd;
}
.markup.quote {
  color: #ffcc66;
}
.markup.raw.inline {
  color: #ff6666;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #ff6666;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.meta.structure.dictionary.value.json .punctuation + .string.quoted.double.json {
  color: #eeeeee;
}
.meta.structure.dictionary.value.json .constant.numeric.json {
  color: #88eedd;
}
.css.entity.pseudo-element {
  opacity: 0.75;
}
